import React from "react";
import "../components/pagesCss/Home.css";
import "../components/pagesCss/GeneralPageCss.css";

function Home() {
  const options = {
    method: "POST",
    headers: {
      "content-type": "application/json",
      "X-RapidAPI-Key": "8e9d221530mshf5b0a61b3cb744fp1810e8jsn63c7e238a636",
      "X-RapidAPI-Host": "amazon-products-api.p.rapidapi.com",
    },
    body: '{"asin":"B08H75RTZ8","host":"www.amazon.com"}',
  };

  fetch("https://amazon-products-api.p.rapidapi.com/get-product-data", options)
    .then((response) => response.json())
    .then((response) => console.log(response))
    .catch((err) => console.error(err));
  return <div className="container general-page">Home</div>;
}

export default Home;
